--
-- Name: expand_timestamp(json); Type: FUNCTION; Schema: cypress_data_ep; Owner: -
--

CREATE FUNCTION expand_timestamp(json) RETURNS timestamp without time zone
    LANGUAGE sql
    AS $_$
   select
     case
       when ($1)::text = 'null' then null
       else (($1)->>'date')::date + (($1)->>'time')::time
     end
$_$;


