CREATE TABLE event_base (
    event_id bigint NOT NULL,
    event json,
    patient_number integer
);


--
-- Name: event; Type: VIEW; Schema: cypress_data_ep; Owner: -
--

CREATE VIEW event AS
 SELECT b.event_id,
    b.patient_number,
    (b.event ->> 'classCode'::text) AS classcode,
    (b.event ->> 'event_type'::text) AS event_type,
    (b.event ->> 'moodCode'::text) AS moodcode,
    (b.event ->> 'status_code'::text) AS status_code,
    (b.event ->> 'text'::text) AS event_text,
    expand_timestamp((b.event -> 'start_time'::text)) AS start_time,
    expand_timestamp((b.event -> 'end_time'::text)) AS end_time,
    expand_timestamp((b.event -> 'effective_time'::text)) AS effective_time,
    ((b.event ->> 'negationInd'::text))::boolean AS negationind,
    (b.codes ->> 'code'::text) AS event_code,
    (b.codes ->> 'codeSystem'::text) AS event_codesystem,
    ((b.event -> 'value'::text) ->> 'code'::text) AS value_code,
    ((b.event -> 'value'::text) ->> 'codeSystem'::text) AS value_codesystem,
    ((b.event -> 'value'::text) ->> 'type'::text) AS value_type,
    ((b.event -> 'value'::text) -> 'translation'::text) AS value_translation,
    ((b.event -> 'value'::text) -> 'unit'::text) AS value_unit,
    (((b.event -> 'value'::text) ->> 'value'::text))::numeric AS value_numeric,
    ((b.event -> 'dischargeDispositionCode'::text) ->> 'code'::text) AS discharge_disposition_code,
    ((b.event -> 'dischargeDispositionCode'::text) ->> 'codeSystem'::text) AS discharge_disposition_codesystem,
    ((b.event -> 'routeCode'::text) ->> 'code'::text) AS route_code,
    ((b.event -> 'routeCode'::text) ->> 'codeSystem'::text) AS route_codesystem,
    ((b.event -> 'targetSiteCode'::text) ->> 'code'::text) AS target_site_code,
    ((b.event -> 'targetSiteCode'::text) ->> 'codeSystem'::text) AS target_site_codesystem,
    ((b.event -> 'priorityCode'::text) ->> 'code'::text) AS priority_code,
    ((b.event -> 'priorityCode'::text) ->> 'codeSystem'::text) AS priority_codesystem
   FROM ( SELECT event_base.event_id,
            event_base.event,
            event_base.patient_number,
            json_array_elements((event_base.event -> 'codes'::text)) AS codes
           FROM event_base) b;


--
-- Name: event_sequence; Type: SEQUENCE; Schema: cypress_data_ep; Owner: -
--

CREATE SEQUENCE event_sequence
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


--
-- Name: event_templates; Type: VIEW; Schema: cypress_data_ep; Owner: -
--

CREATE VIEW event_templates AS
 SELECT x.event_id,
    array_agg(x.t) AS template_ids
   FROM ( SELECT event_base.event_id,
            (json_array_elements((event_base.event -> 'templateId'::text)) ->> 'root'::text) AS t
           FROM event_base) x
  GROUP BY x.event_id;


--
-- Name: expanded_event_templates; Type: VIEW; Schema: cypress_data_ep; Owner: -
--

CREATE VIEW expanded_event_templates AS
 SELECT e.event_id,
    e.event_text,
    regexp_replace(e.event_text, ':.*'::text, ''::text) AS short_event_text,
    t.template_ids
   FROM (event e
     JOIN event_templates t ON ((e.event_id = t.event_id)));


